void karatsuba_2(uint16_t arr1[], uint16_t arr2[], uint16_t res[]){
    res[0] = arr1[0]*arr2[0];
    res[2] = arr1[1]*arr2[1];
    res[1] = (arr1[0]+arr1[1])*(arr2[0]+arr2[1])-res[0]-res[2];

}
void striding_3(uint16_t arr1[], uint16_t arr2[], uint16_t res[]){
    uint16_t a0b0 = arr1[0]*arr2[0];
    uint16_t a1b1 = arr1[1]*arr2[1];
    uint16_t a2b2 = arr1[2]*arr2[2];
    uint16_t d01 = (arr1[0]+arr1[1])*(arr2[0]+arr2[1]);
    uint16_t d02 = (arr1[0]+arr1[2])*(arr2[0]+arr2[2]);
    uint16_t d12 = (arr1[1]+arr1[2])*(arr2[1]+arr2[2]);

   	res[0] = a0b0;
    res[1] = d01-a1b1-a0b0;
    res[2] = d02-a2b2-a0b0+a1b1;
	res[3] = d12-a1b1-a2b2;
    res[4] = a2b2;
}
